array=[[l for l in line] for line in data.split("\n")]



def check_direction(A, i, j, word, x, y):
    for q in range(len(word)):
        if word[q] != A[i + q*x][j + q*y]:
            return False
    return True


def check(A, i, j, word):
    ans = 0
    xlim, ylim = len(A), len(A[0])
    for x in [-1,0,1]:
        for y in [-1,0,1]:
            if x==0 and y==0:
                continue
            xfar = x*(len(word)-1) + i
            yfar = y*(len(word)-1) + j

            if xfar < 0 or yfar < 0 or xfar > xlim-1 or yfar > ylim-1:
                continue
            ans = ans+check_direction(A, i, j, word, x, y)
    return ans


def find_words(A, word):
    height=len(A)
    width=len(A[0])

    ans = 0
    for i in range(height):
        for j in range(width):
            ans=ans+check(A, i, j, word)

    return ans

